      job_description:
        'Want to learn more about this role and Jobot? Click our Jobot logo and follow our LinkedIn page!\n\nJob details\n\nRevolutionize the boat sharing industry 100% work from home\n\nThis Jobot Job is hosted by Charles Simmons\n\nAre you a fit? Easy Apply now by clicking the "Easy Apply" button and sending us your resume.\n\nSalary $120,000 - $150,000 per year\n\nA Bit About Us\n\nThis mid-stage SaaS startup in the short term rental space is working on modernizing a production environment supporting a revenue generating platform with web and mobile applications that is experiencing rapid growth and scaling issues. The engineering team has 11 members and is hoping to fill 3 more spots by the end of the year. This team values engineers that focus on code quality and ownership, following methodical best practices to deliver scalable, highly performant systems that will last long term. Anyone that values a remote first culture and enjoys working on modern software engineering for consumer facing SaaS products should apply!\n\nWhy join us?\n• 100% Telecommute\n• Salary $130-165k base\n• Significant equity vesting over 4 years\n• Comprehensive health, vision, and dental coverage\n• 401k with employer match\n\nJob Details\n\nWe are seeking a passionate and dedicated Senior React Native Developer to join our dynamic and growing team. This is a 100% remote position that provides an opportunity to work with some of the latest technologies and frameworks in the technology industry. As a Senior React Native Developer, you will be at the forefront of developing innovative and user-friendly mobile applications, making a significant impact on the company\'s success.\n\nResponsibilities\n\nAs a Senior React Native Developer, your responsibilities will include\n• Developing high-quality, scalable, and predictable mobile applications using React Native, and TypeScript.\n• Collaborating with cross-functional teams to define, design, and ship new features.\n• Ensuring the performance, quality, and responsiveness of applications.\n• Identifying and correcting bottlenecks and fixing bugs.\n• Implementing Test-Driven Development (TDD) and Continuous Delivery methodologies.\n• Utilizing tools such as Tamagui, Storybook, and Figma to build and test UI components.\n• Leveraging GraphQL for efficient and effective data handling and management.\n• Developing and maintaining native modules for use across multiple platforms.\n• Participating in code reviews to maintain a high-quality codebase.\n• Providing technical guidance and coaching to less experienced developers.\n\nQualifications\n\nThe ideal candidate for the Senior React Native Developer position should have the following qualifications\n• A Bachelor\'s degree in Computer Science, Information Technology, or a related field.\n• Minimum of 3 years of professional experience in React Native development.\n• Proficiency in Hybrid Mobile and TypeScript.\n• Experience with Next.js and Test-Driven Development (TDD).\n• Familiarity with Continuous Delivery methodologies.\n• Experience with Tamagui, Storybook, and Figma.\n• Proficiency in GraphQL and Native Modules.\n• Strong problem-solving skills with a creative approach.\n• Excellent communication skills and the ability to work effectively in a team.\n• Ability to manage multiple projects simultaneously and meet deadlines.\n\nThis is an exciting opportunity for a Senior React Native Developer to join a dynamic and innovative team. If you are passionate about technology, eager to learn, and enjoy working in a fast-paced, team-oriented environment, we would love to hear from you. Apply today and let\'s create something extraordinary together!\n\nInterested in hearing more? Easy Apply now by clicking the "Easy Apply" button.\n\nWant to learn more about this role and Jobot?\n\nClick our Jobot logo and follow our LinkedIn page!',
