      job_description:
        "We are a global company searching for a highly skilled and creative React Native Front-End Developer to join our team. As a React Native Front-End Developer, you will play a key role in designing and developing mobile applications that deliver exceptional user experiences. In addition, you will be responsible for creating front-end websites for our products. If you have a passion for mobile application development, a strong understanding of JavaScript, and experience with web technologies like WebSockets and WebRTC, we want to hear from you.\n\nKey Responsibilities:\n• Collaborate with UX designers to transform Figma prototypes into React Native code\n• Develop and maintain mobile applications using React Native, ensuring high performance and responsiveness\n• Implement and integrate WebSockets and WebRTC for real-time communication in mobile apps\n• Create and optimize user interfaces for mobile devices and websites, following best practices in UI/UX design\n• Work closely with cross-functional teams, including back-end developers and product managers, to deliver high-quality solutions\n• Stay up-to-date with the latest trends and technologies in mobile app and web development\n• Debug and resolve issues, ensuring the reliability and usability of the applications and websites\n\nQualifications:\n• Proven experience in mobile application development using React Native\n• Strong proficiency in JavaScript, including React, Vanilla JS, and jQuery\n• Experience working with UX designers and converting Figma prototypes to React Native code\n• Familiarity with e-commerce development (preferred but not required)\n• Understanding of mobile app and web performance optimization and responsive design\n• Detail-oriented with a strong commitment to delivering high-quality code\n• Excellent communication and collaboration skills\n• Self-motivated and able to work independently and in a team\n• Flexible and willing to adapt to new technologies and challenges\n• Passion for creating exceptional user experiences\n\nAdditional Preferred Skills:\n• Knowledge of PHP and MySQL\n• Previous involvement in e-commerce projects\n• Familiarity with WebSockets, preferably Socket.IO, and WebRTC\n\nHow to Apply:\n\nIf you are a talented React Native Front-End Developer with a passion for creating outstanding mobile experiences and front-end websites, we encourage you to apply. Please submit your resume, portfolio, and a cover letter highlighting your relevant experience and why you'd be a great fit for our team.\n\nBenefits:\n• Competitive salary\n• Health and Dental\n• Opportunities for professional growth and development\n• Collaborative and innovative work environment\n\nJoin us in shaping the future of mobile application and web development and contribute to projects that make a difference. We look forward to welcoming you to our team!\n\nCompany DescriptionIntracta is a live event technology company specializing in content delivery, audience engagement, data collection, reporting and analytics, and App creation.",
